// SPDX-License-Identifier: MIT
pragma solidity ^0.7.6;

import {ERC777} from "../openzeppelin-contracts-3.4.0/contracts/token/ERC777/ERC777.sol";
/// @title CuratorToken
///
/// @dev This is the contract for the Curator token.
///

contract CuratorToken is ERC777 {
    constructor(uint256 initialSupply, address[] memory defaultOperators)
        public
        ERC777("CuratorToken", "CTN", defaultOperators)
    {
        _mint(msg.sender, initialSupply, "", "");
    }
}

